import React from 'react'
import axios from 'axios';
import { useLoaderData } from 'react-router';
// import { request } from 'http';

interface Brewery {
  id: string;
  name: string;
  brewery_type: string;
  address_1?: string | null;
  address_2?: string | null;
  address_3?: null;
  city: string;
  state_province: string;
  postal_code: string;
  country: string;
  longitude?: string | null;
  latitude?: string | null;
  phone?: string | null;
  website_url?: string | null;
  state: string;
  street?: string | null;
}

interface GetBreweriesResponse {
    data: Brewery[]
}

const Breweries = () => {
    const breweries: Brewery[] | any = useLoaderData();

    return (
        <div>
            {breweries.map(brewery => {
                <p key={brewery.id}>{brewery.name}</p>
            })}
        </div>
    )
}

export default Breweries

export const breweriesLoader = async () => {
    try {
        const { data, status } = await axios.get<GetBreweriesResponse>('https://api.openbrewerydb.org/v1/breweries');
        console.log(JSON.stringify(data));
        console.log('Response status: ', status);
        return data
    } catch (error: any) {
        if (axios.isAxiosError(error)) {
            console.log('Error: ', error.message);
            return error.message;
        } else {
            console.log('Unexpected error: ', error);
            return 'An unexpected error occurred';
        }
    }
}
